  position: relative;
  top: 0;
  max-width: 160px;
  height: 48px;
  line-height: 48px;
  padding: 0 10px 0 12px;
  opacity: 0.5;
  color: rgba(197, 200, 198, 0.8);
  border: none;
  overflow: hidden;
  -webkit-transition: opacity 250ms ease;
  -webkit-transform: translate3d(0, 0, 0);
}
.tab-bar .tab .close-icon {
  right: 10px;
  z-index: 3;
  text-align: right;
  line-height: 48px;
  color: rgba(197, 200, 198, 0.8);
  cursor: pointer;
  -webkit-animation: zoomOut 250ms ease;
  -webkit-animation-fill-mode: forwards;
}
.tab-bar .tab .close-icon:hover {
  color: inherit;
}
.tab-bar .tab .close-icon::before {
  font-family: 'Material Icons';
  font-size: 16px;
  line-height: 3;
  content: '\E5CD';
}
.tab-bar .tab:hover .close-icon {
  -webkit-animation: zoomIn 250ms ease;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  right: 10px;
  top: 21px;
  width: 8px;
  height: 8px;
  border-width: 2px;
}
.tab-bar .tab.modified:hover .close-icon:hover {
  color: #fff;
}
.tab-bar .tab.modified:not(:hover) .title::after {
  position: absolute;
  content: '';
  right: 0;
  top: calc(43%);
  border-radius: 50%;
  width: 8px;
  height: 8px;
  border: 2px solid transparent;
}
.tab-bar .tab .title {
  position: relative;
  z-index: 1;
  padding-right: 10px;
  padding-left: 0;
  top: 0 !important;
  transition: padding-left 200ms;
  pointer-events: none;
}
.tab-bar .tab .title::before {
  display: none;
  position: absolute !important;
  top: 50% !important;
  left: 0 !important;
  right: auto;
  bottom: auto;
  transform: translateY(-50%) scale(0) !important;
  transition: all 200ms;
  display: block;
  margin-right: 10px !important;
}
.tab-bar .tab .ink {
  display: none;
  position: absolute;
  border-radius: 50%;
  pointer-events: none;
  width: 2px;
  height: 2px;
  -webkit-transform: translate3d(0, 0, 0);
  background-color: rgba(255, 255, 255, 0.1);
}
.tab-bar .tab::after {
  content: '';
  position: absolute;
  bottom: 0;
  left: 50%;
  right: 50%;
  height: 2px;
  -webkit-transition: left 250ms ease, right 250ms ease;
  -webkit-transform: translate3d(0, 0, 0);
}
.tab-bar .tab.active {
